import React from 'react'

export default function Home(props) {
    const animation = bodymovin.loadAnimation(
        {
        container: document.getElementById('anim'),
        renderer: 'svg',
        loop: true,
        autoplay: true,
        path: 'nameSig.json'
        }
    )

    return (
        <div>
            <p>
                Hello!
            </p>
        </div>
    )
}
